import React from "react";
import { NavLink } from "react-router-dom";

function AddWords() {
  return (
    <div className=" flex flex-col items-center w-full">
      <div className=" w-full  w-[80vw] pl-32 mt-11 h-auto">
        <div className="navlink">
          <NavLink to={"/"} className=" bg-green-700  p-4  rounded-md">
            Anasayfa
          </NavLink>
          <NavLink
            to={"/addwords"}
            className=" bg-green-700 p-4 ml-3  rounded-md"
          >
            Kelime Ekle
          </NavLink>
          <NavLink to={"/words"} className=" bg-green-700 p-4 ml-3 rounded-md">
            Kelimeler
          </NavLink>
        </div>
        <div className=" w-full border h-[500px] mt-10"></div>
      </div>
    </div>
  );
}

export default AddWords;
